import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail 
            author={faker.internet.userName()} timeAgo="Today at 4:45PM" avatar={faker.image.avatar()} content={faker.lorem.text()} />
            <CommentDetail author={faker.internet.userName()} timeAgo="Today at 2:00PM" avatar={faker.image.avatar()} content={faker.lorem.text()} />
            <CommentDetail author={faker.internet.userName()} timeAgo="Yesterday at 5:00PM" avatar={faker.image.avatar()} content={faker.lorem.text()} />
        </div>
    );
};

ReactDOM.render(
    <App />,
    document.querySelector('#root')
);
